import React from 'react';
import Principal from '../components/Principal';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

export default function Secret(props) {
  return (
    <div className='secret_page'>
        <Principal />
        <Router>
        <Routes>
          <Route
            exact
            path="/"
            element={
              isLoggedIn ? <Navigate to="/secret" /> : <Home />
            }
          />
          <Route
            exact
            path="/login"
            element={
              isLoggedIn ? <Navigate to="/secret" /> : <Login login={login} />
            }
          />
          <Route
            exact
            path="/register"
            element={
              isLoggedIn ? (
                <Navigate to="/secret" />
              ) : (
                <Register login={login} />
              )
            }
          />
          <Route
            exact
            path="/secret"
            element={
              !isLoggedIn ? (
                <Navigate to="/secret" />
              ) : (
                <Secret logout={logout} />
              )
            }
          />
        </Routes>
      </Router>
        <footer>
        <button onClick={()=>props.logout()}>Log Out</button>
        </footer>
    </div>
  )
}
